import { useState } from "react";
import Modal from "../modal";

import buttonImg from "../../assets/buttonPlus.png";

import "./index.css";

export default function Header() {
  const [contClickInput, setContClickInput] = useState(0)
  const [open, setOpen] = useState(false);

  function handleInputModal() {
    if (contClickInput == 0) {
      setOpen(false)
      setContClickInput(1)
    }
    else if (contClickInput == 1){
      setOpen(true)
      setContClickInput(0)
    }
    console.log(contClickInput)
  }

  return (
    <>
      <header>
        <h2>Veículo</h2>
        <input
          type="checkbox"
          id="buttonModal"
          onChange={(e) => setOpen(e.target.checked)}
          onClick={handleInputModal}
        />
        <label id="buttonModalLabel" htmlFor="buttonModal">
          <img src={buttonImg} alt="botão redondo plus" />
        </label>
      </header>
      <Modal open={open} id="modal" />
    </>
  );
}
